import styled from "styled-components";

const Texto = styled.p`
    font-family: "Just Me Again Down Here", cursive;
    color: black;
    font-size: 30px;
    width: 100%
    position: relative;
    white-space: pre-wrap; 
    margin: 0;
    word-wrap: break-word;
    overflow-wrap: break-word;
`;

export default Texto;
